MOD_CMD_DEF(embox__cmd__net__arp, "arp", "Manipulate the system ARP cache", "\n"
	"\t\tNAME\n"
	"\t\t\tarp - manipulate the system ARP cache.\n"
	"\t\tSYNOPSIS\n"
	"\t\t\tarp [-hds] [-a addr] [-m addr] [-i ifs]\n"
	"\t\tDESCRIPTION\n"
	"\t\t\tarp with no mode specifier will print the\n"
	"\t\t\t\tcurrent content of the table.\n"
	"\t\tOPTIONS\n"
	"\t\t\t-i - select  an  interface\n"
	"\t\t\t-d - will delete a ARP table entry\n"
	"\t\t\t-s - used to set up a new table entry\n"
	"\t\t\t-a - ip address\n"
	"\t\t\t-m - mac address\n"
	"\t\t\t-h - show this help\n"
	"\t\tEXAMPLES\n"
	"\t\t\tarp -s -a 10.0.3.97 -m 11:22:AA:44:FF:11 -i eth0\n"
	"\t\t\t\tThis will add new entry to ARP table.\n"
	"\t\t\tarp -d -a 10.0.0.2\n"
	"\t\t\t\tDelete the ARP table entry for 10.0.0.2.\n"
	"\t\tSEE ALSO\n"
	"\t\t\tifconfig, route\n"
	"\t\tAUTHORS\n"
	"\t\t\tNikolay Korotky\n"
	"\t");
MOD_CMD_DEF(embox__cmd__net__netstat, "netstat", "Print network connections, interface statics", "\n"
	"\t\tNAME\n"
	"\t\t\tnetstat - Print network connections\n"
	"\t\tOPTIONS\n"
	"\t\t\t-c\tReprint information every second\n"
	"\t\t\t-l\tPrint only listening sockets\n"
	"\t\t\t-a\tPrint listening and non-listening sockets\n"
	"\t\tAUTHORS\n"
	"\t\t\tAlexander Kalmuk\n"
	"\t");
MOD_CMD_DEF(embox__cmd__net__arping, "arping", "Send ARP REQUEST to a neighbour host", "\n"
	"\t\tNAME\n"
	"\t\t\tarping - send ARP REQUEST to a neighbour host\n"
	"\t\tSYNOPSIS\n"
	"\t\t\tarping [ -c count] [-I iface] destination\n"
	"\t\tDESCRIPTION\n"
	"\t\t\tPing destination on device interface by ARP packets,\n"
	"\t\t\tusing source address source.\n"
	"\t\tOPTIONS\n"
	"\t\t\t-I interface\n"
	"\t\t\t\tSet source address to specified interface address.\n"
	"\t\t\t\tby default: eth0\n"
	"\t\t\t-c count\n"
	"\t\t\t\tStop after sending count ECHO_REQUEST packets.\n"
	"\t\t\t\tby default: 4 (-1 infinity)\n"
	"\t\tEXAMPLES\n"
	"\t\t\tarping -c 3 10.0.3.97\n"
	"\t\tSEE ALSO\n"
	"\t\t\tarp, ping\n"
	"\t\tAUTHORS\n"
	"\t\t\tNikolay Korotky\n"
	"\t");
MOD_CMD_DEF(embox__cmd__net__rarping, "rarping", "Send RARP REQUEST to a neighbour host", "\n"
	"\t\tNAME\n"
	"\t\t\trarping - send RARP REQUEST to a neighbour host\n"
	"\t\tSYNOPSIS\n"
	"\t\t\trarping [ -c count] [-I iface] destination\n"
	"\t\tDESCRIPTION\n"
	"\t\t\tPing destination on device interface by RARP packets,\n"
	"\t\t\tusing source address source.\n"
	"\t\tOPTIONS\n"
	"\t\t\t-I interface\n"
	"\t\t\t\tSet source address to specified interface address.\n"
	"\t\t\t\tby default: eth0\n"
	"\t\t\t-c count\n"
	"\t\t\t\tStop after sending count ECHO_REQUEST packets.\n"
	"\t\t\t\tby default: 4 (-1 infinity)\n"
	"\t\tEXAMPLES\n"
	"\t\t\trarping -c 3 aa:bb:cc:dd:ee:ff\n"
	"\t\tSEE ALSO\n"
	"\t\t\tarp, ping, arping\n"
	"\t\tAUTHORS\n"
	"\t\t\tIlia Vaprol\n"
	"\t");
MOD_CMD_DEF(embox__cmd__net__ifconfig, "ifconfig", "Configure a network interface", "\n"
	"\t\tNAME\n"
	"\t\t\tifconfig - configure a network interface\n"
	"\t\tSYNOPSIS\n"
	"\t\t\tifconfig [-a] [-s] [interface]\n"
	"\t\t\tifconfig interface [aftype] options | address ...\n"
	"\t\tDESCRIPTION\n"
	"\t\t\tIfconfig is used to configure the kernel-resident\n"
	"\t\t\tnetwork interfaces. If no arguments are given, ifconfig\n"
	"\t\t\tdisplays the status of the currently active interfaces.\n"
	"\t\t\tcommand changes ip/mac addresses of specified interface.\n"
	"\t\tOPTIONS\n"
	"\t\t\t-a\t\tdisplay all interfaces which are currently available, even if down\n"
	"\t\t\t-s\t\tdisplay a short list\n"
	"\t\t\tinterface\n"
	"\t\t\t\t\tthe name of the interface\n"
	"\t\t\tup\t\tactivate interface\n"
	"\t\t\tdown\tshutdown interface\n"
	"\t\t\t[-]arp\tenable or disable ARP protocol on this interface\n"
	"\t\t\t[-]promisc\n"
	"\t\t\t\t\tenable or disable promiscuous mode on this interface\n"
	"\t\t\t[-]allmulti\n"
	"\t\t\t\t\tenable or disable all-multicast mode\n"
	"\t\t\tmtu N\tset the MTU for this interface\n"
	"\t\t\tnetmask addr\n"
	"\t\t\t\t\tset the network mask for this interface\n"
	"\t\t\tirq N\tset the interrupt number for interface device\n"
	"\t\t\tio_addr N\n"
	"\t\t\t\t\tset the base address for interface device\n"
	"\t\t\t[-]broadcast [addr]\n"
	"\t\t\t\t\tif addr is given, set protocol broadcast address; otherwise set (or clear)\n"
	"\t\t\t\t\tIFF_BROADCAST flag for interface\n"
	"\t\t\t[-]pointopoint [addr]\n"
	"\t\t\t\t\tenable point-to-point mode on this interface\n"
	"\t\t\thw class address\n"
	"\t\t\t\t\tset the hardware address of this interface\n"
	"\t\t\tmulticast\n"
	"\t\t\t\t\tset the multicast flag on this iterface\n"
	"\t\t\taddress\n"
	"\t\t\t\t\tthe IP address to be assigned to this interface\n"
	"\t\tEXAMPLES\n"
	"\t\t\tifconfig eth0 10.0.2.16 netmask 255.255.255.0 up\n"
	"\t\t\t\tThis will setup new interface eth0.\n"
	"\t\tSEE ALSO\n"
	"\t\t\troute, arp\n"
	"\t\tAUTHORS\n"
	"\t\t\tAnton Bondarev, Alexandr Batyukov, Ilia Vaprol\n"
	"\t");
MOD_CMD_DEF(embox__cmd__net__ping, "ping", "Send ICMP ECHO_REQUEST to network hosts", "\n"
	"\t\tNAME\n"
	"\t\t\tping - send ICMP ECHO_REQUEST to network hosts\n"
	"\t\tSYNOPSIS\n"
	"\t\t\tping [-I iface] [-c count] [-W timeout] [-t ttl]\n"
	"\t\t\t[-p pattern] [-t ttl] [-s packsize] [ -i interval]\n"
	"\t\t\tdestination\n"
	"\t\tDESCRIPTION\n"
	"\t\t\tping uses the ICMP protocol s mandatory ECHO_REQUEST\n"
	"\t\t\tdatagram to elicit an ICMP ECHO_RESPONSE from a host\n"
	"\t\t\tor gateway.\n"
	"\t\t\tTest whether a particular host is reachable\n"
	"\t\tOPTIONS\n"
	"\t\t\t-I interface\n"
	"\t\t\t\tSet source address to specified interface address.\n"
	"\t\t\t\tby default: eth0\n"
	"\t\t\t-c count\n"
	"\t\t\t\tStop after sending count ECHO_REQUEST packets.\n"
	"\t\t\t\tby default: 4 (-1 infinity)\n"
	"\t\t\t-W timeout\n"
	"\t\t\t\tTime to wait for a response, in seconds.\n"
	"\t\t\t\tby default: 1 second\n"
	"\t\t\t-t ttl\n"
	"\t\t\t\tSet the IP Time to Live.\n"
	"\t\t\t-s packetsize\n"
	"\t\t\t\tSpecifies  the number of data bytes to be sent.\n"
	"\t\t\t\tThe default is 56.\n"
	"\t\t\t-i interval\n"
	"\t\t\t\tWait  interval seconds between sending each packet.\n"
	"\t\t\t\tThe default is to wait for 1 second\n"
	"\t\t\t-p pattern\n"
	"\t\t\t\t16 ``pad'' bytes to fill out the packet you send.\n"
	"\t\tEXAMPLES\n"
	"\t\t\tping -c 3 10.0.3.97\n"
	"\t\t\tThis will send 3 ECHO_REQUEST to 10.0.3.97\n"
	"\t\tSEE ALSO\n"
	"\t\t\tifconfig\n"
	"\t\tAUTHORS\n"
	"\t\t\tAlexandr Batyukov, Anton Bondarev, Nikolay Korotky\n"
	"\t\t\tIlia Vaprol, Daria Dzendzik\n"
	"\t");
MOD_CMD_DEF(embox__cmd__net__iptables, "iptables", "Administration tools for manipulation over IP traffic", "\n"
	"\t\tNAME\n"
	"\t\t\tiptables - tools for packet filtering\n"
	"\t\tSYNOPSIS\n"
	"\t\t\tiptables -A chain rule-specification\n"
	"\t\t\tiptables -R chain rulenum rule-specification\n"
	"\t\t\tiptables -D chain rulenum\n"
	"\t\t\tiptables -F [chain]\n"
	"\t\t\tiptables -L [chain [rulenum]]\n"
	"\t\t\tiptables -P chain target\n"
	"\t\tDESCRIPTION\n"
	"\t\t\tIptables is utility for IPv4 packet filtering and NAT\n"
	"\t\tOPTIONS\n"
	"\t\t\tchain\tone of the standard chains: INPUT for the input\n"
	"\t\t\t\t\ttraffic, FORWARD for the forwarding packets and\n"
	"\t\t\t\t\tOUTPUT for outgoing packets.\n"
	"\t\t\trulenum\n"
	"\t\t\t\t\tnumber of the rule to apply the action\n"
	"\t\t\ttarget\tone of the targets: ACCEPT means to let the\n"
	"\t\t\t\t\tpacket and DROP means to drop the packet\n"
	"\t\t\tCOMMANDS\n"
	"\t\t\t-A, --append chain rule-specification\n"
	"\t\t\t\t\tappend rule to the end of the selected chain\n"
	"\t\t\t-R, --replace chain rulenum rule-specification\n"
	"\t\t\t\t\treplace a specified rule in the selected chain\n"
	"\t\t\t-D, --delete chain rulenum\n"
	"\t\t\t\t\tdelete rule from the selected chain. The rule\n"
	"\t\t\t\t\tspecified as a number in the chain (starting\n"
	"\t\t\t\t\tat 1 from the first rule)\n"
	"\t\t\t-F, --flush [chain]\n"
	"\t\t\t\t\tflush the selected chain (all the chains if none\n"
	"\t\t\t\t\tis given)\n"
	"\t\t\t-L, --list [chain [rulenum]]\n"
	"\t\t\t\t\tlist all rules in the selected chain or all\n"
	"\t\t\t\t\tchains if no chain is selected\n"
	"\t\t\t-P, --policy chain target\n"
	"\t\t\t\t\tset the policy for the chain to the given target\n"
	"\t\t\t-h, --help\n"
	"\t\t\t\t\thelp message\n"
	"\t\t\tPARAMETERS\n"
	"\t\t\t[!] -p, --protocol protocol\n"
	"\t\t\t\t\tselect protocol for rule: icmp, tcp or udp.\n"
	"\t\t\t[!] -s, --source address\n"
	"\t\t\t\t\tset source address\n"
	"\t\t\t[!] -d, --destination address\n"
	"\t\t\t\t\tset destination address\n"
	"\t\t\t-j, --jump target\n"
	"\t\t\t\t\tspecify the target of the rule\n"
	"\t\t\t[!] --sport, --source-port port\n"
	"\t\t\t\t\tsource port specification\n"
	"\t\t\t[!] --dport, --destination-port port\n"
	"\t\t\t\t\tdestination port specification\n"
	"\t\tEXAMPLE\n"
	"\t\t\tiptables -A INPUT -p tcp -j DROP --dport 80\n"
	"\t\t\tBlocking incoming traffic for HTTP server\n"
	"\t\tAUTHORS\n"
	"\t\t\tIlia Vaprol\n"
	"\t");
MOD_CMD_DEF(embox__cmd__net__route, "route", "Manipilate routing table", "\n"
	"\t\tNAME\n"
	"\t\t\troute - show / manipulate the IP routing table.\n"
	"\t\tSYNOPSIS\n"
	"\t\t\troute [-n]\n"
	"\t\t\troute [-A family] {add|del} <target> [gw <Gw>]\n"
	"\t\t\t\t\t[netmask <Nm>] [[dev] If]\n"
	"\t\t\troute [-h]\n"
	"\t\tOPTIONS\n"
	"\t\t\tadd\n"
	"\t\t\t\tadd a new route.\n"
	"\t\t\tdel\n"
	"\t\t\t\tdelete a route.\n"
	"\t\t\ttarget\n"
	"\t\t\t\ttarget IP address\n"
	"\t\t\t-h  help message\n"
	"\t\t\t-n  show numeric adresses instead of trying\n"
	"\t\t\t\tto determine symbolic name\n"
	"\t\t\t-A  specify address family. Only inet supported (DARPA internet).\n"
	"\t\t\t\tinet is used by default.\n"
	"\t\t\tgw  specify gateway for subnet\n"
	"\t\t\tnetmask\n"
	"\t\t\t\tspecify network mask for subnet.\n"
	"\t\t\t[dev] If\n"
	"\t\t\t\tuse this interface for current net\n"
	"\t\tEXAMPLE\n"
	"\t\t\troute -n\n"
	"\t\t\troute add default gw 10.0.2.10 eth0\n"
	"\t\tOUTPUT\n"
	"\t\t\tThe output contains this columns:\n"
	"\t\t\t\tDestination\n"
	"\t\t\t\t\tDestination host or destination net.\n"
	"\t\t\t\tGateway\n"
	"\t\t\t\t\tThe gateway address or '*' of not set.\n"
	"\t\t\t\tNetmask\n"
	"\t\t\t\t\tShould be 255.255.255.255 for host.\n"
	"\t\t\t\tFlags. Possible flags:\n"
	"\t\t\t\t\tU - route is up\n"
	"\t\t\t\t\tG - use gateway\n"
	"\t\t\t\t\tH - target is host\n"
	"\t\t\t\tIface\n"
	"\t\t\t\t\tInterface to which IP packets are to be sent.\n"
	"\t\tSEE ALSO\n"
	"\t\t\tifconfig, arp, netstat\n"
	"\t\tAUTHOR\n"
	"\t\t\tNikolay Korotky, Ilia Vaprol, Vladimir Sokolov, Denis Deryugin\n"
	"\t");
